INSERT INTO `homyit_frame_help` VALUES ('37', '登录问题', '2、已经下线为什么还提示用户已在线？', '<p>系统对同一账号，在同一时刻仅允许在某一处登录。因此对于已经在别处登录的账号，则不允许再次登录。</p><p>如果您没有登录账号，则需要注意防范可能是别人在登录您的账号，请及时修改密码。（您可以通过在登录页通过验证邮箱重置密码）</p><p>如果您刚刚登录了，并且关闭了浏览器，现在</p><p>提示用户已经在线，是因为限于WEB技术无连接状态的特性，需要过段时间等服务器注销了该用户的缓存信息才能登录。目前设定为8分钟！</p><p>同样，如果您在某一页面停留超过8分钟，可能也会要求重新登录！</p><p><strong>为了避免您出现实际已经退出系统</strong>，但是提示用户在线的问题，<strong>请您每次退出系统时单击右上角头像处的<span style=\"text-decoration:underline;\">退出按钮</span>以实现正常的退出流程</strong>。届时您可以在退出系统后随意再次登录！</p>', '1', '800');
INSERT INTO `homyit_frame_help` VALUES ('38', '登录问题', '1、为什么第一次登录时加载时间比较长？', '<p style=\"text-indent:28px\"><span style=\"font-family:宋体\">系统使用了大量的</span><span>CSS</span><span style=\"font-family:宋体\">、</span><span>JavaScript</span><span style=\"font-family:宋体\">等静态资源，在保证了良好的交互体验与视觉体验的同时也增加了浏览器的压力。因此我们采用时下流行的</span><span>AngularJS</span><span style=\"font-family:宋体\">的思想，将静态资源在系统第一次加载系统时进行缓存，登录进系统后绝大多数页面的加载与服务器的数据传输在</span><span>50KB</span><span style=\"font-family:宋体\">以内，以保证后续操作的流畅度。这也就是为什么您第一次登录本系统，或者清空缓存后第一次登录本系统加载时间较长。此外，我们队登录页也提供了页面加载进度显示，希望能缓解您的这种焦虑！</span></p><p><br/></p>', '1', '950');
